import React from 'react';
import './DialogsPage.css';
import SidebarComponent from "../Sidebar/Sidebar";
import HeaderComponent from "../Header/Header";
import DialogsComponent from "../Dialogs/Dialogs";

const DialogsPage = () => {

    let userMe = {
        name: 'Я',
        id: 1
    };
    let user1 = {
        name: 'Дмитрий',
        id: 2
    };
    let user2 = {
        name: 'Василий',
        id: 3
    };
    let allMessagesWithUser1 = [{itsAutor: userMe.name, itsMessage: "Привет!"},
                                {itsAutor: user1.name, itsMessage: "И тебе здарова)"}];

    let allWritersMassiv = [
        user1, user2
    ];

    return (
        <div className={'page-box'}>
            <div className={'header'}>
                <HeaderComponent/>
            </div>
            <div className="content-wrapper">
                <div className={'sidebar-block'}>
                    <SidebarComponent/>
                </div>
                <div className={'content'}>
                    <DialogsComponent allWriter={allWritersMassiv} />
                </div>
            </div>
        </div>
    );
}

export default DialogsPage;
